INSERT INTO `books` VALUES (2,'Harry Potter e a Pedra Filosofal','208','J. K. Rowling','Harry Potter é um garoto órfão que vive infeliz com seus tios, os Dursleys. Ele recebe uma carta contendo um convite para ingressar em Hogwarts, uma famosa escola especializada em formar jovens bruxos. Inicialmente, Harry é impedido de ler a carta por seu tio, mas logo recebe a visita de Hagrid, o guarda-caça de Hogwarts, que chega para levá-lo até a escola. Harry adentra um mundo mágico que jamais imaginara, vivendo diversas aventuras com seus novos amigos, Rony Weasley e Hermione Granger.\r\n',''),(3,'Harry Potter e a Câmara Secreta','224','J. K. Rowling','Depois de férias aborrecidas na casa dos tios trouxas, está na hora de Harry Potter voltar a estudar. Coisas acontecem, no entanto, para dificultar o regresso de Harry. Persistente e astuto, o herói não se deixa intimidar pelos obstáculos e, com a ajuda dos fiéis amigos Weasley, começa o ano letivo na Escola de Magia e Bruxaria de Hogwarts. As novidades não são poucas. Novos colegas, novos professores, muitas e boas descobertas e um grande e perigosos desafio. Alguém ou alguma coisa ameaça a segurança e a tranquilidade dos membros de Hogwarts.',''),(4,'Harry Potter e o Prisioneiro de Azkaban','288','J. K. Rowling','As aulas estão de volta à Hogwarts e Harry Potter não vê a hora de embarcar no expresso a vapor que o levará de volta à escola de bruxaria. Mais uma vez suas férias na rua dos Alfeneiros foi triste e solitária. Com muita ação, humor e magia, \'Harry Potter e o prisioneiro de Azkaban\' traz de volta o gigante atrapalhado Rúbeo Hagrid, o sábio diretor Alvo Dumbledore, a exigente professora de transformação Minerva MacGonagall e o novo mestre Lupin, que guarda grandes surpresas para Harry.',''),(5,'Harry Potter e o Cálice de Fogo','480','J. K. Rowling','Nesta aventura, o feiticeiro cresceu e está com 14 anos. O início do ano letivo de Harry Potter reserva muitas emoções, mágicas, e acontecimentos inesperados, além de um novo torneio em que os alunos de Hogwarts terão de demonstrar todas as habilidade mágicas e nãomágicas que vêm adquirindo ao longo de suas vidas. Harry é escolhido pelo Cálice de Fogo para competir como um dos campeões de Hogwarts, tendo ao lado seus fiéis amigos. Muitos desafios, feitiços, poções e confusões estão reservados para Harry. Além disso, ele terá que lidar ainda com os problemas comuns da adolescência amor, amizade, aceitação e rejeição.',''),(6,'Harry Potter e a Ordem de Fênix','640','J. K. Rowling','Harry não é mais um garoto. Aos 15 anos, continua sofrendo a rejeição dos Dursdley, sua estranha família no mundo dos \'trouxas\'. Também continua contando com Rony Weasley e Hermione Granger, seus melhores amigos em Hogwarts, para levar adiante suas investigações e aventuras. Mas o bruxinho começa a sentir e descobrir coisas novas, como o primeiro amor e a sexualidade. Nos volumes anteriores, J. K. Rowling mostrou como Harry foi transformado em celebridade no mundo da magia por ter derrotado, ainda bebê, Voldemort, o todopoderoso bruxo das trevas que assassinou seus pais. Neste quinto livro da saga, o protagonista, numa crise típica da adolescência, tem ataques de mau humor com a perseguição da imprensa, que o segue por todos os lugares e chega a inventar declarações que nunca deu. Harry vai enfrentar as investidas de Voldemort sem a proteção de Dumbledore, já que o diretor de Hogwarts é afastado da escola. E vai ser sem a ajuda de seu protetor que o jovem herói enfrentará descobertas sobre a personalidade controversa de seu pai, Tiago Potter, e a morte de alguém muito próximo.',''),(7,'Harry Potter e o Enigma do Príncipe','432','J. K. Rowling','Harry Potter e o enigma do príncipe\' dá continuidade à saga do jovem bruxo Harry Potter a partir do ponto em que o livro anterior parou o momento em que fica provado que o poder de Voldemort e dos Comensais da Morte, seus seguidores, cresce mais a cada dia, em meio à batalha entre o bem e o mal. A onda de terror provocada pelo Lorde das Trevas estaria afetando, até mesmo, o mundo dos trouxas (nãobruxos), e sendo agravada pela ação dos dementadores, criaturas mágicas aterrorizantes que \'sugam\' a esperança e a felicidade das pessoas. Harry, que acabou de completar 16 anos, parte rumo ao sexto ano na Escola de Magia e Bruxaria de Hogwarts, animado e ao mesmo tempo apreensivo com a perspectiva de ter aulas particulares com o professor Dumbledore, o diretor da escola e o bruxo mais respeitado em toda comunidade mágica. Harry, longe de ser aquele menino magricela que vivia no quarto debaixo da escada na casa dos tios trouxas, é um dos principais nomes entre aqueles que lutam contra Voldemort, e se vê cada vez mais isolado à medida que os rumores de que ele é O Eleito o único capaz de derrotar o Lorde das Trevas, se espalham pelo mundo dos bruxos. Dois atentados contra a vida de estudantes, a certeza de Harry quanto ao envolvimento de Draco Malfoy com os Comensais da Morte e o comportamento de Snape, suspeito como sempre, adicionam ainda mais tensão ao já inquietante período. Apesar de tudo isso, Harry e os amigos são adolescentes típicos dividem tarefas escolares e dormitórios bagunçados, correm das aulas para os treinos de quadribol, e namoram.',''),(8,'Harry Potter e as Relíquias da Morte','512','J. K. Rowling','Harry Potter e as relíquias da morte\', de J.K. Rowling, é o sétimo e último livro da série. Voldemorte está cada vez mais forte e Harry Potter precisa encontrar e aniquilar as Horcruxes para enfraquecer o lorde e poder enfrentálo. Nessa busca desenfreada, contando apenas com os amigos Rony e Hermione, Harry descobre as Relíquias da Morte, que serão úteis na batalha do bem contra o mal.','');
INSERT INTO `books` VALUES (9,'O Iluminado','464','Stephen King','O romance, magistralmente levado ao cinema por Stanley Kubrick, continua apaixonando (e aterrorizando) novas gerações de leitores. A luta assustadora entre dois mundos. Um menino e o desejo assassino de poderosas forças malignas. Uma família refém do mal. Nesta guerra sem testemunhas, vencerá o mais forte. Danny Torrance não é um menino comum. É capaz de ouvir pensamentos e transportar-se no tempo. Danny é iluminado. Será uma maldição ou uma bênção? A resposta pode estar guardada na imponência assustadora do hotel Overlook. Em O iluminado, quando Jack Torrance consegue o emprego de zelador no velho hotel, todos os problemas da família parecem estar solucionados. Não mais o desemprego e as noites de bebedeiras. Não mais o sofrimento da esposa, Wendy. Tranquilidade e ar puro para o pequeno Danny livrar-se das convulsões que assustam a família. Só que o Overlook não é um hotel comum. O tempo esqueceu-se de enterrar velhos ódios e de cicatrizar antigas feridas, e espíritos malignos ainda residem nos corredores. O hotel é uma chaga aberta de ressentimento e desejo de vingança. É uma sentença de morte. E somente os poderes de Danny podem fazer frente à disseminação do mal.','');
INSERT INTO `books` VALUES (10,'Assassinato no Expresso do Oriente','240','Agatha Christie','Em meio a uma viagem, Hercule Poirot é surpreendido por um telegrama solicitando seu retorno a Londres. Então, o famoso detetive belga embarca no Expresso do Oriente, que está inesperadamente cheio para aquela época do ano. Pouco tempo após a meia-noite, o excesso de neve nos trilhos obriga o trem a parar. Na manhã seguinte, o corpo de um dos passageiros é encontrado, golpeado por múltiplas facadas. Isolados, e com um assassino entre eles, a única solução é que Poirot inicie uma investigação para descobrir quem é o criminoso ― antes que ele faça mais uma vítima. \r\n\r\nO livro é parte das novas edições de luxo de Agatha Christie da HarperCollins, com novas traduções, capa dura e detalhes sobre a obra ao final da história. Você vai se surpreender a cada plot twist.',''),(11,'O Intérprete de Borboletas','240','Sérgio Abranches','O intérprete de borboletas trata de personagens que vivem o dia a dia das grandes cidades brasileiras, com histórias, anseios e questões que nos levam a enxergar nossa própria vida com outros olhos. Quem não possui um tio, um primo, irmãos, pais ou amigos com posições políticas e valores radicalmente diferentes? No livro, como no cotidiano brasileiro, este desacordo intensifica também a desigualdade social, fazendo com que os mais vulneráveis sejam oprimidos pela dinâmica perversa que a todo momento os exclui e nega-lhes condições básicas de vida.\r\n\r\nSérgio Abranches estrutura este romance a partir de dois núcleos familiares. Um deles formado por uma menina entrando na adolescência e tentando se encontrar; a mãe, recém-convertida à religião, que não entende a filha e tenta moldá-la a seus novos padrões de comportamento; e o pai, mais compreensivo, que busca ajudar a filha e impedir rupturas definitivas na relação entre elas. O outro é composto de dois irmãos que passaram a se odiar por divergências políticas. Entre um núcleo e outro, vários personagens têm a vida transformada por algo em comum: a polarização e a violência que tomaram conta do país.\r\n\r\nSobre essas turbulências, em que pessoas com ideias contrárias não conseguem mais dialogar, paira o Velho. Sua vivência da política começou nas ruas de Paris, em 1968, quando os protestos dos estudantes tiveram seu ápice. Ao voltar ao Brasil, aderiu à indignação geral contra a ditadura militar. Foi preso, torturado e mantido em uma solitária por sete anos. Agora, quase como um guru, ele vive recolhido e isolado em um sítio, rodeado de árvores e borboletas. Seu discurso carregado de experiência procura abrir um caminho pacífico entre os radicalismos e resgatar a capacidade de se conviver com as diferenças.\r\n\r\nExtremamente atual, com referências de Racionais MCs e poesia slam às manifestações políticas do século XX e dos dias atuais, O intérprete de borboletas tece uma história sobre rupturas e divergências que modificam de forma definitiva as relações.\r\n\r\n“Solitárias, as pessoas se reúnem em grupos fechados, em casulos de intolerância, e os rumos do afeto se perdem na aridez e na desconfiança do outro. Os sentimentos ficam intoxicados, as mágoas se multiplicam, o afeto se desfaz no descaimento das memórias, no esquecimento das alegrias, no entorpecimento da estima, no fim da empatia, no incêndio voluntário e repetido das pontes, em portas batidas e trancadas. O outro é inimigo, e se o outro é meu extremo, eu sou o extremo do outro. Um define o outro pela negação. Tudo impede o retorno. O recomeço. Tudo parece fim.”','');
INSERT INTO `books` VALUES (12,'Juntos para sempre','320','W. Bruce Cameron','A continuação de Quatro vidas de um cachorro, o best-seller do The New York Times que emocionou milhões!Amigão, agora um cão velho que sentiu que cumpriu o seu objetivo de vida (ou vidas) vive feliz com Hannah. Porém, quando Gloria, uma aspirante a cantora, chega com Clarity, uma neta que Hannah não sabia que existia, Amigão se responsabiliza pelo bem-estar da menina, em especial ao ver o quanto Gloria não se importa com a própria filha. Assim, uma nova jornada começa, e o animal tem um novo objetivo: proteger e amar Clarity da forma incondicional que apenas um cachorro pode fazer.','');
INSERT INTO `books` VALUES (13,'A garota do lago','296','Charlie Donlea','Summit Lake, uma pequena cidade entre montanhas, é esse tipo de lugar, bucólico e com encantadoras casas dispostas à beira de um longo trecho de água intocada.Duas semanas atrás, a estudante de direito Becca Eckersley foi brutalmente assassinada em uma dessas casas. Filha de um poderoso advogado, Becca estava no auge de sua vida. Atraída instintivamente pela notícia, a repórter Kelsey Castle vai até a cidade para investigar o caso. ...E LOGO SE ESTABELECE UMA CONEXÃO ÍNTIMA QUANDO UM VIVO CAMINHA NAS MESMAS PEGADAS DOS MORTOS...E enquanto descobre sobre as amizades de Becca, sua vida amorosa e os segredos que ela guardava, a repórter fica cada vez mais convencida de que a verdade sobre o que aconteceu com Becca pode ser a chave para superar as marcas sombrias de seu próprio passado.','');
